from typing import List

class Solution:
    def countSubMultisets(self, nums: List[int], l: int, r: int) -> int:
        MOD = 10**9 + 7
        max_sum = sum(nums)
        dp = [[0] * (max_sum + 1) for _ in range(2)]
        dp[0][0] = 1

        for num in nums:
            for sum_val in range(max_sum + 1):
                dp[1][sum_val] = dp[0][sum_val]
                if sum_val >= num:
                    dp[1][sum_val] += dp[0][sum_val - num]
                dp[1][sum_val] %= MOD
            dp[0] = dp[1][:]

        result = 0
        for sum_val in range(l, r + 1):
            result += dp[0][sum_val]
            result %= MOD

        return result
